# Display in std::fmt - Rust

## Trait [std](../index.html)::[fmt](index.html)::[Display](#)

1.0.0 · [source](https://doc.rust-lang.org/1.80.0/src/core/fmt/mod.rs.html#716) ·

```
pub trait Display {
    // Required method
    fn fmt(&self, f: &mut Formatter<'_>) -> Result<(), Error>;
}
```

Expand description

Format trait for an empty format, `{}`.

Implementing this trait for a type will automatically implement the [`ToString`](../../std/string/trait.ToString.html) trait for the type, allowing the usage of the [`.to_string()`](about:blank/std/string/trait.ToString.html#tymethod.to_string) method. Prefer implementing the `Display` trait for a type, rather than [`ToString`](../../std/string/trait.ToString.html).

`Display` is similar to [`Debug`](trait.Debug.html "trait std::fmt::Debug"), but `Display` is for user-facing output, and so cannot be derived.

For more information on formatters, see [the module-level documentation](../../std/fmt/index.html).

## [§](#internationalization)Internationalization

Because a type can only have one `Display` implementation, it is often preferable to only implement `Display` when there is a single most “obvious” way that values can be formatted as text. This could mean formatting according to the “invariant” culture and “undefined” locale, or it could mean that the type display is designed for a specific culture/locale, such as developer logs.

If not all values have a justifiably canonical textual format or if you want to support alternative formats not covered by the standard set of possible [formatting traits](about:blank/std/fmt/index.html#formatting-traits), the most flexible approach is display adapters: methods like [`str::escape_default`](about:blank/primitive.str.html#method.escape_default "method str::escape_default") or [`Path::display`](about:blank/std/path/struct.Path.html#method.display) which create a wrapper implementing `Display` to output the specific display format.

## [§](#examples)Examples

Implementing `Display` on a type:

```
use std::fmt;

struct Point {
    x: i32,
    y: i32,
}

impl fmt::Display for Point {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "({}, {})", self.x, self.y)
    }
}

let origin = Point { x: 0, y: 0 };

assert_eq!(format!("The origin is: {origin}"), "The origin is: (0, 0)");
```

